  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Pea Island
  National Wildlife Refuge summarizes Refuge activities during the 1984 calendar year.
  \ The report begins with a summary of the yearu2019s highlights and climatic conditions.
  \ The report includes a planning section which discusses the master plan, public
  participation, and compliance with environmental mandates.  Refuge administration
  is outlined; information about personnel, youth programs, volunteer programs, funding,
  safety, and technical assistance is given.  Habitat management is also covered.
  \ Subjects include wetlands, croplands, and fire management.  The wildlife section
  of the report discusses wildlife diversity, endangered species, threatened species,
  waterfowl, marsh birds, water birds, shorebirds, raptors, game mammals, marine mammals,
  scientific collections, animal control, marking, and bird banding.  The public uses
  of the Refuge described in this report include outdoor classrooms, interpretive
  exhibits, hunting, fishing, trapping, wildlife observation, and law enforcement.
  \ The equipment and facilities section of the report provides information about
  new construction, rehabilitation, major maintenance, and equipment utilization/replacement.
  \ Cooperative programs and items of interest are provided at the end; Refuge brochures
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
